import React from "react";

const Home = props => {

    return (
        <React.Fragment>
            <div className="each-component">
                <p>I am Home</p>
                <ul>
                    <li>Carousel item: EQ</li>
                    <li>Carousel item: IQ</li>
                    <li>Carousel item: Mentee</li>
                </ul>
            </div>
        </React.Fragment>
    );

};

export default Home;
